import React,{useState} from 'react';

function HomePage() {



    const [childComponents, setChildComponents] = useState<any>([]);

  const addChildComponent = () => {
    setChildComponents([...childComponents, {}]);
  };

  const Section = () => {
    const [name, setName] = useState('');

    const handleNameChange = (e:any) => {
      setName(e.target.value);
    };

    const handlePostData = () => {
      // Replace with your API POST request logic here
      // Example: fetch('your-api-url', { method: 'POST', body: JSON.stringify({ name }) });
      console.log(`Posting name: ${name}`);
    };

    return (
      <div>
        <input
          type="text"
          placeholder="Enter Name"
          value={name}
          onChange={handleNameChange}
        />
        <button onClick={handlePostData}>Add Name</button>
      </div>
    );
  };


  const ChildComponent = () => {
    const [sections, setSections] = useState<any>([]);

    const addSection = () => {
      setSections([...sections, { id: Date.now() }]);
    };

    return (
      <div>
        <button onClick={addSection}>Add Section</button>
        {sections.map((section:any) => (
          <Section key={section.id} />
        ))}
      </div>
    );
  };

  const [components, setComponents] = useState<any>([]);

  const addComponent = () => {
    setComponents([...components, { sections: [] }]);
  };

  const addSection = (index:any) => {
    const updatedComponents = [...components];
    updatedComponents[index].sections.push({});
    setComponents(updatedComponents);
  };




    return (
        // JSX content here
        <div>

       <div>
      <button onClick={addComponent}>Add Component</button>
      {components.map((component:any, index:any) => (
        <div key={index} className="square-component">
          <button onClick={() => addSection(index)}>Add Section</button>
          {component.sections.map((_:any, sectionIndex:any) => (
            <div key={sectionIndex} className="section">
              Section {sectionIndex + 1}
            </div>
          ))}
        </div>
      ))}
    </div>
      </div>
    );
}

export default HomePage;
